import styled from "styled-components";
import NBRLYImage from "../images/NBRLY.png";

const AllProjectsContainer = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: items;
  margin: 4em 2em 2em 2em;
`;

const SingleJobContainer = styled.span`
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: items;
  padding: 0em 5em 2em 5em;
`;

const ProjectDescription = styled.span`
  padding: 0 0 0 2em;
`;

const ProjectImg = styled.img`
  width: 25vw;
`;

const Projects = () => {
  return (
    <AllProjectsContainer>
      <h3 style={{ textAlign: "center" }}>NBRLY</h3>
      <SingleJobContainer>
        <ProjectImg src="https://www.codingdojo.com/blog/wp-content/uploads/6.jpg" />
        <ProjectDescription>
          <p>
            A full stack web app that connects you with the people around you.
            By answering the simple question, "What do you want to do today?"
            you are instantly linked with like-minded people in your geographic
            vicinity interested in doing the same activity. From sports to
            nightlife, and everything in between. Built with React and node, in
            collaboration with developers Robin Edwards and Anna Balquin. App
            currently in construction. Click here to view code.
          </p>
        </ProjectDescription>
      </SingleJobContainer>

      <h3 style={{ textAlign: "center" }}>NASA Images Search Engine</h3>
      <SingleJobContainer>
        <ProjectImg src="https://www.codingdojo.com/blog/wp-content/uploads/6.jpg" />
        <ProjectDescription>
          <p>
            A search engine app for NASA's image library. API endpoint was
            provided as part of the brief. User is able to search for and return
            relevant images. Built with React. Click here to view code. Click
            here to view deployed app.
          </p>
        </ProjectDescription>
      </SingleJobContainer>
      <h3 style={{ textAlign: "center" }}>Weather App</h3>
      <SingleJobContainer>
        <ProjectImg src="https://www.codingdojo.com/blog/wp-content/uploads/6.jpg" />
        <ProjectDescription>
          <p>
            The app uses the Open Weather API to retrieve and display 5-day
            weather forecast data for towns and cities in the UK. It includes
            detailed information such as: min and max temperature, humidity,
            wind direction and speed as well as a general description and icon
            depicting the general forecast. Made with React. Click here to view
            code. Click here to view deployed app.
          </p>
        </ProjectDescription>
      </SingleJobContainer>
    </AllProjectsContainer>
  );
};

export default Projects;
